import { Row } from "react-bootstrap"
import Movie from "./movieList"
const MoviesList = (props) => {
    return (
      <Row className="mt-2">
        {
          // console.log(props.movies.length)
          props.movies.length >= 1 ? (
            props.movies.map((ele) => <MoviesList data={ele} />)
          ) : (
            <h1>no movies</h1>
          )
        }
      </Row>
    );
}
export default MoviesList
